CREATE TABLE PlayerInfo(
   Player       VARCHAR(50) NOT NULL
  ,No           INTEGER 
  ,Class        VARCHAR(50)
  ,Pos          VARCHAR(50)
  ,Ht           VARCHAR(50)
  ,Wt           INTEGER 
  ,Hometown     VARCHAR(50)
  ,HS           VARCHAR(50)
  ,HS_Rk        VARCHAR(50)
  ,Summary      VARCHAR(50)
  ,PRIMARY KEY(Player,Hometown)
);
